function CreateChartArrayBasedOnList_POI(input_ChartArray, input_allowedCharts)
	local output_ChartArray = {}

    for _, chart in ipairs(input_ChartArray) do
        local description = chart:GetDescription()
        
        for _, allowedChart in ipairs(input_allowedCharts) do
            if description == allowedChart then
                table.insert(output_ChartArray, chart)
                break  -- No need to continue checking if the chart has been added
            end
        end
    end

    return output_ChartArray
end

function FilterChartFromSublist_POI(input_CurGroupName,input_CurrentIndex,input_ChartArray)
	-- declares our output
	local outputChartArray = input_ChartArray
	
	-- don't use any logic if the group is "All Tunes"
	if input_CurGroupName == "All Tunes" or input_CurGroupName == "OffsetControl" or input_CurGroupName == "POI-database" then
		return input_ChartArray
	end
		
	-- grabbing the playlistName by looking at input_CurGroupName
	local playlistName = input_CurGroupName:match("^(.-)\n\n\n")
	-- grabbing the sublistDesc by looking at input_CurGroupName
	local sublistDesc = input_CurGroupName:match("(\n\n\n.*)$")
	-- grabbing the sublistName by looking at input_CurGroupName
	local sublistName = ""
	for _, playlistData in ipairs(Database_POI()) do
        if playlistData[1] == playlistName then
            for _, subgroup in ipairs(playlistData) do
                if type(subgroup) == "table" and subgroup[2] == sublistDesc then
                    sublistName = subgroup[1]
                end
            end
        end
    end
	
	-- grabs an array of strings, representing the charts that are allowed to be displayed considering this Playlist, this Sublist, and this MusicWheel SongIndex
	local listOfAllowedChartsAsString = GetAllowedCharts_POI(playlistName,sublistName,input_CurrentIndex)	
	
	-- creates an array of Chart objects that match the list of charts allowed in
	outputChartArray = CreateChartArrayBasedOnList_POI(input_ChartArray, listOfAllowedChartsAsString)
	
	-- checks if outputChartArray was left empty
	if #outputChartArray == 0 then
		return {} -- this will make the function return an empty ChartArray, and ChartDisplay.lua will repopulate it with all possible charts for this song "to avoid other crashes" in their words
	end
	
	return outputChartArray
end

function FetchFirstTag_POI(input_song)
	local output = ""
	
	local fullTagAttribute = input_song:GetTags()
	
	if fullTagAttribute ~= "" then
		local words = {} -- array of strings, one for each separate word
		for thisWord in fullTagAttribute:gmatch("%S+") do
			table.insert(words, thisWord)
		end		
		output = words[1] -- gets the first word in that array
	end
	
	return output
end

function FetchSecondTag_POI(input_song)
	local output = ""
	
	local fullTagAttribute = input_song:GetTags()
	
	if fullTagAttribute ~= "" then
		local words = {} -- array of strings, one for each separate word
		for thisWord in fullTagAttribute:gmatch("%S+") do
			table.insert(words, thisWord)
		end	
		
		-- Check if the words table has more than one element
		if #words >= 2 then
			output = words[2] -- gets the second word in that array		
		end
	end
	
	return output
end

function FetchChartName_POI(input_Chart)
	local output = ""
    
    local ChartFullChartnameFromSSC = input_Chart:GetChartName()
    local openParen = ChartFullChartnameFromSSC:find("%(")
    output = ChartFullChartnameFromSSC:sub(1, openParen - 2)
	
    return output
end

function FetchChartOrigin_POI(input_Chart)
	local output = ""
    
    local ChartFullChartnameFromSSC = input_Chart:GetChartName()
    local ChartPOIName = ""    
    local openParen = ChartFullChartnameFromSSC:find("%(")
    local closeParen = ChartFullChartnameFromSSC:find("%)")
    ChartPOIName = ChartFullChartnameFromSSC:sub(1, openParen - 2)
    output = ChartFullChartnameFromSSC:sub(openParen + 1, closeParen - 1)
    
    return output
end

function GetColor_POI(inputString)
	local outputColor = ""
	
	local found = false
	local foundIndex = nil
	for i, colorRelationship in ipairs(TableOfColors_POI()) do
		if TableOfColors_POI()[i][1] == inputString then
            found = true
			foundIndex = i
            break -- break if found to avoid unnecessary iterations
        end
	end
	if found then
        outputColor = TableOfColors_POI()[foundIndex][2]
	else
		return TableOfColors_POI()[1][2] -- handle the case where the input string doesn't have a corresponding color
	end
	
	return outputColor
end

function ColorFromSongOrigin_POI(input_song) return GetColor_POI(input_song:GetOrigin()) end

function ColorFromSongGenre_POI(input_song) return GetColor_POI(input_song:GetGenre()) end

function ColorFromChartStepstype_POI(input_chart)
	local outputColor = ""
	
	if FetchChartName_POI(input_chart):sub(1, 3) == "IDK" then
		outputColor = GetColor_POI("IDK")
	elseif input_chart:GetAuthorCredit() == "Placeholder" then
		outputColor = GetColor_POI("Placeholder")
	else 
		outputColor = GetColor_POI(ToEnumShortString(ToEnumShortString(input_chart:GetStepsType())))
	end
	
	return outputColor
end

function GetPlaylistBanner_POI(input_playlistName)
	local output = "Common fallback banner" -- handle the case where the input string doesn't have a corresponding playlist
	
	for _, playlistData in ipairs(Database_POI()) do
		if playlistData[1] == input_playlistName then
			output = playlistData[2] -- return the playlist banner path if found
		end
	end
	
	return output
end

function GetSublistBanner_POI(input_playlistName, input_sublistName)
	local output = "Common fallback banner" -- handle the case where the input strings doesn't have a corresponding playlist and/or sublist
	
	for _, playlistData in ipairs(Database_POI()) do
		if playlistData[1] == input_playlistName then
			for _, sublistData in ipairs(playlistData) do
				if type(sublistData) == "table" and sublistData[1] == input_sublistName then
					output = sublistData[3]
					break -- exit the loop once the sublist is found
				end
			end
			break -- exit the loop once the playlist is found
		end
	end
	
	return output
end

function FormatDate_POI(input_date)	
	local output = ""
	
	-- Split the input string based on the hyphen separator
	local parts = string.split(input_date, "-")
	
	-- Assign each part to the corresponding variable
	local YearAsString = parts[1] or ""
	local MonthAsNumberString = parts[2] or ""
	local DayAsNumberString = parts[3] or ""
	
	-- Format the month
	local MonthAsString = ""
	local monthMap = {
		["01"] = "Jan", ["02"] = "Feb", ["03"] = "Mar", ["04"] = "Apr", ["05"] = "May", ["06"] = "Jun", 
		["07"] = "Jul", ["08"] = "Aug", ["09"] = "Sep", ["10"] = "Oct", ["11"] = "Nov", ["12"] = "Dec"
	}
	MonthAsString = monthMap[MonthAsNumberString] or ""
	
	-- Creates output
	output = YearAsString .. ", " .. DayAsNumberString .. " " .. MonthAsString
	
	return output
end